import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import { faCheckSquare, faCoffee } from '@fortawesome/fontawesome-free-solid'
import { Link } from "react-router-dom";



import "./Navbar.css"
const Navbar = () => {

    return (
<div className="navb">

        <nav>
            <input type="checkbox" id="check" />
            <label for="check" class="checkbtn">
                {/* <FontAwesomeIcon icon="fa-solid fa-bars" /> */}
                <FontAwesomeIcon icon="fa-solid fa-bars" />
            </label>
            <label class="logo"><img style={{ width: 100, paddingTop: 18 }} src={logo} alt="Logo du site" /></label>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/">ZERTYUe</Link></li>
                <li><Link to="/">iilyrouid</Link></li>
                <li><Link to="/Contact">CONTACT</Link></li>
                <li className="localisation checkbtn" id="check"><Link to="/">LOCALISATION</Link></li>
            </ul>
        </nav>
</div>




    );
}

export default Navbar;
